const HomePhysiotherapist = (props) => {
  const [users, setUsers] = useState([]);
  const [filter, setFilter] = useState("");
  const [loading, setLoading] = useState(true);
  // const logOut = async () => {
  //   // props.navigation.navigate("Login");
  //   // await firebase.auth.signOut();

  //   // this.checkAsync();
  //   Alert.alert(
  //     "Cerrar Sesión",
