  //           await firebase.auth.signOut();
  //         },
  //       },
  //     ],
  //     { cancelable: false }
  //   );
  // };

  const getUsers = async () => {
    let collection;
    const collection1 = await firebase.db
      .collection("users")
      .where("physioEmail", "==", props.user.email)
      .get();
    const collection2 = await firebase.db
      .collection("users")
      .where("personal.id", "==", filter)
      .get();
    filter == "" ? (collection = collection1) : (collection = collection2);

    let exercisesProcessed: any = collection.docs.map((doc) => {
      return {
        ...doc.data(),
        uid: doc.id,
      };
    });

    console.log("Los ejercicios son", exercisesProcessed);

    setUsers(exercisesProcessed);
    setLoading(false);
  };
  useEffect(() => {
    getUsers();
  }, []);
  if (loading) {
    return (
      <View
        style={{
          backgroundColor: "#ffffff",
          justifyContent: "center",
          height: "100%",
          width: "100%",
        }}
      >
        <ChargeScreen />
      </View>
    );
  } else {
    return (
      <View style={styles.container}>
        <View style={styles.header}>
          <Text style={{ fontSize: vmin(4.5), fontWeight: "bold" }}>
            {props.user.information.personal.name}
          </Text>
          <Text style={{ fontSize: vmin(3) }}>
            {props.user.information.personal.email}
          </Text>
        </View>
        <View style={styles.containerInput}>
          <TextInput
            style={styles.input}
            onChangeText={(value) => {
              setFilter(value);
            }}
            placeholder={"Filtrar por cédula de usuario"}
          />
          <TouchableOpacity
            style={styles.filterButton}
            onPress={() => {
              getUsers();
            }}
          >
            <Text style={{ color: "white", fontSize: vmin(6) }}>➔</Text>
          </TouchableOpacity>
        </View>
        <ScrollView style={styles.body}>
          {users.length > 0 ? (
            users.map((user) => renderUser(user, props))
          ) : (
            <View>
              <Text
                style={{
                  textAlign: "center",
                  fontSize: vmin(8),
                  color: "rgba(153, 153, 153, 1)",
                  marginTop: "50%",
                }}
              >
                No tiene pacientes bajo su cargo por el momento.
              </Text>
            </View>
          )}
        </ScrollView>

        <View style={styles.footer}>
          {/* <TouchableOpacity
          style={styles.button}
          onPress={() => props.navigation.navigate("UserEventList")}
        >
          <Text style={{ color: "white" }}>Eventos</Text>
        </TouchableOpacity> */}
          {props.connection && (
            <TouchableOpacity
              style={styles.button}
              onPress={() =>
                props.navigation.navigate("UpdatePhysioData", { props: props })
              }
            >
              <Text style={{ color: "white" }}>Editar Perfil</Text>
            </TouchableOpacity>
          )}
          <TouchableOpacity
            style={styles.button}
            onPress={() => {
              props.navigation.navigate("Repository");
            }}
          >
            <Text style={{ color: "white" }}>Catálogo de Información</Text>
          </TouchableOpacity>
        </View>
      </View>
    );
  }
};

const MapStateToProps = (store: MyTypes.ReducerState) => {
  return {
    user: store.User.user,
    connection: store.User.connection,
  };
};

const MapDispatchToProps = (dispatch: Dispatch, store: any) => ({
  setUser: (val) => dispatch(actionsUser.SET_USER(val)),
});
export default connect(
  MapStateToProps,
  MapDispatchToProps
)(HomePhysiotherapist);

